YiEwicjsi4gb2HAxWfQxIBHQzdCac=","commandMetadata":{"webCommandMetadata":{"url":"/@elithecomputerguy","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCD4EOyXKjfDUhCI6jlOZZYQ","canonicalBaseUrl":"/@elithecomputerguy"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/ytc/AIdro_nI8Nsp72nBPKBtVmoV1fK-fhD3QUB8VMcFjBYM6QoAArs=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Show more"}},"simpleText":"...more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Info:\n\nLevel: Beginner\nPresenter: Eli the Computer Guy\nLength: 30 Minutes\nTracks:\n\nSecurity / Data Integrity\nPrerequisites:\n\nNone\nPurpose of Class:\n\nThis class introduces you to the basic concepts of computer security.\n\nTopics Covered:\n\nDefining Hackers\nUpdating Software\nAntivirus Software\nAntimalware Software\nFirewalls\nSite Advisors\nInternet Security Suites\nWeb Browser Security Problems\nClass Notes:\n\nDefining Hacker\nThere are many reasons why people hack.  Some do it for fun, profit or to prove a point.\nHacking is simple enough that a 9 year old can do it.\nSoftware Flaws / Updates\nAre the prime reasons computers are compromised\nAnti Virus\nProtects against viruses\nA virus is self replicating and tries to damage a computer\nAnti Malware\nMalware is software that's primary purpose is not to damage a computer\nMalware generally tries to collect information about a user, or tries to force a user to visit sites or buy products.\nFirewall\nHardware firewalls are built into routers\nSoftware firewalls are installed onto your computer\n\"Security\" Suites\nSecurity Suites can be worse than hackers -- We have met the enemy and he is us.\nPermissions\nIf you use an account other than ADMINISTRATOR or ROOT when you normally use your computer you will be more secure.\nSite Advisors\nWarn you if you are going to an \"unsafe\" site\nWeb Browsers\nThe Problem with Internet Explorer is that is does more than just browse the Internet.\nFirefox  and Chrome are better but still have problems","styleRuns":[{"startIndex":0,"length":1478,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":1478,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"horizontalCardListRenderer":{"cards":[{"macroMarkersListItemRenderer":{"title":{"simpleText":"Intro"},"timeDescription":{"simpleText":"0:00"},"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/y7VpbOWFsoU/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLBiHasUvNgOh97SIeKaNJWmIBYlcg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/y7VpbOWFsoU/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLCUUT66yMFFdZFRCoY3GqY3yYIDSA","width":336,"height":188}],"lightColorPalette":{"section1Color":4294966523,"section2Color":4294505457,"section3Color":4294109927,"primaryTitleColor":4279833361,"secondaryTitleColor":4285880911,"section4Color":4293649117},"darkColorPalette":{"section1Color":4282331434,"section2Color":4281542434,"section3Color":4280687897,"primaryTitleColor":4294962661,"secondaryTitleColor":4291604387,"section4Color":4279833361}},"onTap":{"clickTrackingParams":"CDYQ0NAGGAAiEwicjsi4gb2HAxWfQxIBHQzdCac=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=y7VpbOWFsoU\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"y7VpbOWFsoU","continuePlayback":true,"startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr5---sn-vgqsrnls.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oa
